features.script:
// -- feature 3D model Follow 
setInterval(() => {
  let p = parcel.getPlayers()[0]

  if (!p) {
    return
  }

  let v1 = feature.position
  let v2 = p.position
  let angle = Math.atan2(v1.z - v2.z, v1.x - v2.x)

  feature.rotation.y = Math.PI / -2 - angle

  // Move the object towards the player at a fixed speed
  let speed = 0.02
  let dx = v2.x - v1.x
  let dz = v2.z - v1.z
  let distance = Math.sqrt(dx * dx + dz * dz)
  if (distance > 1.5) {
    feature.position.x += dx / distance * speed
    feature.position.z += dz / distance * speed
  }
}, 200)
